import React from "react";
import { Link } from "react-router-dom";
import "./HomePage.css";

const Homepage = () => {
  return (
    <div className="homepage">
      <div className="logo-container">
        <img src="/path/to/logo.png" alt="Football Manager Logo" className="logo" />
      </div>

      <div className="button-groups">
        {/* Sol taraftaki butonlar */}
        <div className="left-buttons">
          <Link to="/Players" className="button">Players</Link>
          <Link to="/wonderkids" className="button">Wonder Kids</Link>
          <Link to="/clubs" className="button">Clubs</Link>
        </div>

        {/* Sağ taraftaki butonlar */}
        <div className="right-buttons">
          
          <Link to="/freetransfers" className="button">Free Transfers</Link>
          <Link to="/login" className="button">Log In</Link>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
